Death Flight
The historic flight of a high-speed airliner has garnered much media attention. Approved for an experimental trip from New York to Paris, Captain Jim Walsh will try for the world record flight time. But that's all about to change when mechanical sabotage and a deadly outbreak threaten the lives of everyone on board.

2103: The Deadly Wake
In 2103, one corporation will do anything for world domination...even if that means sending an entire ship and its crew out into the ocean with deadly cargo. Now the captain must try to save the ship in order to stop a global catastrophe.

Road Ends
Dennis Hopper, Peter Coyote, Chris Sarandon and Mariel Hemingway star in this non-stop suspense thriller. As an innkeeper and a sheriff unknowingly harbor Maceda, a drug kingpin on the run, Maceda's associates and FBI agents close in on their man.

Shock Troop
The President of the United States has a serious problem on his handsÃ¢â‚¬â€a top-secret, experimental piece of equipment has been stolen from the military and is now in the possession of the Soviets.

Final Move
A former detective gets the opportunity to right one wrong from his past when he challenges a serial killer called The Grand MasterÃ¢â‚¬â€a maniac known for his chess obsession.

Without Warrant
Gang violence has reached a new level and it's time to put some professionals on the case. But when Jimmy, a young, by-the-book cop is paired with a hardened, rule-breaking veteran, it looks as though these two might be too different for the job.

Cost of a Soul
When soldiers Tommy and DD return from war to the rough city streets that raised them, they struggle to shake the instinct to kill. Meanwhile, life around them begins to crumble and they ultimately learn the true Cost of a Soul. 


